var grobjects = grobjects || [];

var Mountains = undefined;

(function() {
	"use strict";

	var shaderProgram = undefined;
	var texCoords;
	var indexData;
	var buffer;

	var images = [];
	var image1 = new Image();
	image1.src = "data:image/jpeg;base64,";
	images.push(image1);
	var image2 = new Image();
	image2.src = "data:image/jpeg;base64,";
	images.push(image2);
	var image3 = new Image();
	image3.src = "data:image/jpeg;base64,";
	images.push(image3);

	var findAttribLocations = function (gl, program, attributes) {
		var out = {};
		for(var i = 0; i < attributes.length;i++){
			var attrib = attributes[i];
			out[attrib] = gl.getAttribLocation(program, attrib);
		}
		return out;
	}

	var enableLocations = function (gl, attributes) {
		for(var key in attributes){
			var location = attributes[key];
			gl.enableVertexAttribArray(location);
		}
	}

	//always a good idea to clean up your attrib location bindings when done. You wont regret it later. 
	var disableLocations = function (gl, attributes) {
		for(var key in attributes){
			var location = attributes[key];
			gl.disableVertexAttribArray(location);
		}
	}

	//creates a gl texture from an image object. Sometiems the image is upside down so flipY is passed to optionally flip the data.
	//it's mostly going to be a try it once, flip if you need to. 
	var createGLTexture = function (gl, image, flipY) {
		var texture = gl.createTexture();
		gl.bindTexture(gl.TEXTURE_2D, texture);
		if(flipY)
			gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true);
		gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, image);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.LINEAR);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.LINEAR);
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.REPEAT);//gl.CLAMP_TO_EDGE
		gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.REPEAT);
		gl.generateMipmap(gl.TEXTURE_2D);
		gl.bindTexture(gl.TEXTURE_2D, null);
		return texture;
	}

	Mountains = function Mountains(name, position, size) {
		this.name = name;
		this.position = position || [0,0,0];
		this.size = size || 1.0;
		this.program = null;
		this.attributes = null;
		this.textures = [];
		this.shapes = new Shapes();
		this.vertices = null;
		this.uvs = [];
		this.numMountains = 1;
	}

	Mountains.prototype.init = function (drawingState) {
		if (!shaderProgram) 
			shaderProgram = twgl.createProgramInfo(drawingState.gl, ["vs", "fs"]);

		var gl = drawingState.gl;

		this.program = shaderProgram.program;
		this.attributes = findAttribLocations(gl, this.program, ["vPos", "vTexCoord"]);

		var radius = 9;
		this.numMountains = 20;
		var theta = (Math.PI/180) * (360/this.numMountains); //Degrees = radians * (180 / )
		var data = {vertices: [], texCoords: [], normals: []};
		for (var i=0; i<this.numMountains; i++) {
			var newData = this.shapes.setupCone2(2.5+Math.random()*2-1, 3.5+Math.random()*3.5-1.75, Math.cos(theta*i) * radius, 0, Math.sin(theta*i) * radius, Math.random()-0.5);
			data.vertices.push.apply(data.vertices, newData.vertices);
			data.texCoords.push.apply(data.texCoords, newData.texCoords);
			data.normals.push.apply(data.normals, newData.normals);
		}
		
		for (var i=0; i<this.numMountains; i++)
			this.textures.push(createGLTexture(gl, images[Math.floor(Math.random()*images.length)], true));

		buffer = twgl.createBufferInfoFromArrays(drawingState.gl, {vPos: data.vertices, 
			inColor: data.vertices, vNormal: data.normals});

		texCoords = gl.createBuffer();
		gl.bindBuffer(gl.ARRAY_BUFFER, texCoords);
		gl.bufferData(gl.ARRAY_BUFFER, new Float32Array(data.texCoords), gl.STATIC_DRAW);
		texCoords.itemSize = 2;
		texCoords.numItems = data.texCoords.length / 2;
	} 

	Mountains.prototype.center = function () {
		return this.position;
	}

	Mountains.prototype.draw = function (drawingState) {
		var gl = drawingState.gl;

		gl.useProgram(this.program);
		gl.disable(gl.CULL_FACE);

		var modelM = twgl.m4.scaling([this.size,this.size, this.size]);
		twgl.m4.setTranslation(modelM,this.position, modelM);

		var normMatrix = twgl.m4.inverse(twgl.m4.transpose(modelM));
		twgl.setBuffersAndAttributes(drawingState.gl,shaderProgram,buffer);
		twgl.setUniforms(shaderProgram,{isMountains: 1,
			normalMatrix: normMatrix, view:drawingState.view, proj:drawingState.proj, 
			lightDir:drawingState.sunDirection, model: modelM});

		gl.activeTexture(gl.TEXTURE0);
		enableLocations(gl, this.attributes)

		for (var i=0; i<this.numMountains; i++) {
			gl.activeTexture(gl.TEXTURE0);
			gl.bindTexture(gl.TEXTURE_2D, this.textures[i]);

			gl.bindBuffer(gl.ARRAY_BUFFER, texCoords);
			gl.vertexAttribPointer(this.attributes.vTexCoord, texCoords.itemSize, gl.FLOAT, false, 0, 0);

			gl.drawArrays(gl.TRIANGLES, texCoords.numItems/this.numMountains*i, texCoords.numItems/this.numMountains);
		}

		disableLocations(gl, this.attributes);
	}
})();
grobjects.push(new Mountains("Mountains",[0,0.005,0],3));